Burning Angel - Rubbing Bushes
------------------------------

Joanna had Brittany Lynn and Gabriella over for a Cumtastic Cookout, and thought they'd hit it off instantly, but it didn't exactly go that way. Brittany was really offended by the graphic on Gabriella's new T-shirt, and picked fights with her all day. But a twist of fate in the afternoon changed all that...and eventually they DID hit it off. In the bushes. Literally.

